script: |
  super -f text -I q3435.spq | sort > q3435.out

inputs:
  - name: q3435.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE + col2 BETWEEN - col2 * - col0 + - 81 / col1 + + col0 AND 30 + + col1 + - + col2 * + CAST ( NULL AS REAL ) + + + ( - 83 ) * - col1;
  - name: tab1

outputs:
  - name: q3435.out
    data: |
